import React from 'react';
import '../assets/styles/Notification.css';

const Notification = () => (
  <div className="notification-popup">
    <ul>
      <li>Notification 1</li>
      <li>Notification 2</li>
      <li>Notification 3</li>
    </ul>
  </div>
);

export default Notification;
